тельной власти города Москвы 10.Подготовка материалов и предложений по созданию безопасных условий и охраны труда для включения в проекты трехсторонних городских, отраслевых и территориальных соглашений в рамках системы социального партнерства для обсуждения на заседаниях отраслевых комиссий по охране труда, межведомственных комиссий по охране труда при префектурах административных округов и управах районов города Москвы"]]]]]

